import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Hi brother.
        </p>
      </header>
    </div>

  );
}

class WeatherDisplay extends Component {
  render(){
    return (
      <h1>Weather in Paris!</h1>
    );
  }
}

export default App;
